<!DOCTYPE html>
<html>
    <head>
        <style>
        :root {
            height: 110vh;
        }
        * {
            font-family: "monaco", "Lucida Sans Typewriter", monospace;
            color: rgb(0, 0, 0);
        }
        body {
            margin: 0vw;
            padding: calc(3vw + 1ex);
            height: 110vh;
            overflow-x: hidden;
        }
        #background {
            background-color: rgb(#eee);
        }
        #backgroundi {
            position: fixed;
            transform: scale(2);
            top: 30%;
            left: 27%;
            overflow: hidden;
        }
        span {
            font-size: xx-large;
            font-family: "monaco", "Lucida Sans Typewriter", monospace;
        }
        div#top {
            font-size: small;
            font-family: "monaco", "Lucida Sans Typewriter", monospace;
        }
        textarea {
            background-color: rgba(0,0,0,0);
            border: 0vw;
            resize: none;
            padding: 1ex;
            scrollbar-width: none;
        }
        textarea::-webkit-scrollbar {
            display: none;
        }
        #sidePane {
            position: fixed;
            width: 1vw;
            right: 0%;
            top: 0%;
            bottom: 90%;
            background-color: rgba(255,0,0,0);
            
        }
        #contents.enabled {
            display: flex;
            animation: fadein 0.8s ease;
        }
        #contents {
            display: none;
            padding: 1.5ex;
            background-color: rgba(55,55,55,0.2);
            position: fixed;
            width: 15vw;
            min-width: 12ex;
            max-width: 30ex;
            top: 0%;
            height: 20ex;
            right: 0%;
            z-index: 5;
            pointer-events: none;
        }
        #contents * {
            pointer-events: initial;
        }
        #close {
            padding: 1.5ex;
            bottom: 0%;
            right: 0%;
            position: absolute;
            font-size: small;
            transition: all ease 1s;
        }
        #close:hover {
            color: rgb(255, 200, 200);
        }
        a:link, a:visited, a:focus { 
            color: rgb(0, 0, 0);
            text-decoration-line: none!important;
            -moz-text-decoration-line: none!important;
            -webkit-text-decoration-line: none!important;
        }
        a:hover {
            animation-duration: 1s;
            animation-name: linkhover;
            animation-iteration-count: 1;
            animation-fill-mode: forwards;
            opacity: 70%;
            cursor: text;
            color: rgb(0, 0, 0);
        }
        a:not(a:hover) {
            animation-duration: 0.8s;
            animation-name: unlinkhover;
        }
        @keyframes mvisible {
            from {
                opacity: 80%;
            }

            to {
                opacity: 100%;
            }
        }
        @keyframes mnvisible {
            from {
                opacity: 20%;
            }

            to {
                opacity: 0%;
            }
        }
        @keyframes linkhover {
            from {
                opacity: 100%;
                 
            }
            
            to {
                opacity: 70%;
            }
            
        }
        @keyframes unlinkhover {
            from {
                opacity: 70%;
                 
            }
            
            to {
                opacity: 100%;
            }
            
        }
        @keyframes fadein {
            from {
                opacity: 0%;
            }
            1% {
                display: flex;
                opacity: 0%;
            }
            to {
                opacity: 100%;
            }
        }
        #blue1, #blue2, #blue3, #green1 {
            transition: all 0.9s ease;
            pointer-events: visibleStroke;
            display: none;
        }
        #things {
            font-size: small;
        }
        #things a {
            margin-right: 1em;
        }
        #k * {
            display: flex;
            justify-content: center;
        }
        </style>
    </head>
